import {useState} from 'react'

function Home() {
  return (
    <div>
      <h1>Home</h1>
      <Contador />
    </div>
  )
}

const Contador = () => {
  const [contador, setContador] = useState(1)

  adicionarContador = () => {
    setContador(contador + 1)
  }

  return (
    <div>
      <div>{contador}</div>
      <button onClick={adiocionarContador}>Adicionar</button>
    </div>
  )
}

export default Home
